import{f as n,g as s,J as a}from"./common-03e46d7f.js";const p='{"title":"跟着卡哥学算法Day 20：二叉树常见题目7","frontmatter":{"date":"2025-03-03","title":"跟着卡哥学算法Day 20：二叉树常见题目7","tags":["leetcode"],"describe":"二叉树常见题目7"},"headers":[{"level":2,"title":"235. 二叉搜索树的最近公共祖先 🌟🌟","slug":"_235-二叉搜索树的最近公共祖先-🌟🌟"},{"level":3,"title":"题目描述","slug":"题目描述"},{"level":3,"title":"解题思路","slug":"解题思路"},{"level":2,"title":"701.二叉搜索树中的插入操作 🌟🌟","slug":"_701-二叉搜索树中的插入操作-🌟🌟"},{"level":3,"title":"题目描述","slug":"题目描述-2"},{"level":2,"title":"#","slug":"https-programmercarl-com-0701-e4-ba-8c-e5-8f-89-e6-90-9c-e7-b4-a2-e6-a0-91-e4-b8-ad-e7-9a-84-e6-8f-92-e5-85-a5-e6-93-8d-e4-bd-9c-html-算法公开课"},{"level":3,"title":"解题思路","slug":"解题思路-2"},{"level":2,"title":"450.删除二叉搜索树中的节点 🌟🌟","slug":"_450-删除二叉搜索树中的节点-🌟🌟"},{"level":3,"title":"题目描述","slug":"题目描述-3"},{"level":3,"title":"解题思路","slug":"解题思路-3"}],"relativePath":"docs/leetcode/binary-tree-code6.md","lastUpdated":1742176930054.5972}';var t={};const o=[a('<h2 id="_235-二叉搜索树的最近公共祖先-🌟🌟"><a class="header-anchor" href="#_235-二叉搜索树的最近公共祖先-🌟🌟" aria-hidden="true">#</a> 235. 二叉搜索树的最近公共祖先 🌟🌟</h2><p><a href="https://leetcode.cn/problems/lowest-common-ancestor-of-a-binary-search-tree/description/" target="_blank" rel="noopener noreferrer">力扣链接</a> 🌟🌟</p><h3 id="题目描述"><a class="header-anchor" href="#题目描述" aria-hidden="true">#</a> 题目描述</h3><p>给定一个二叉搜索树, 找到该树中两个指定节点的最近公共祖先。</p><p>百度百科中最近公共祖先的定义为：“对于有根树 T 的两个结点 p、q，最近公共祖先表示为一个结点 x，满足 x 是 p、q 的祖先且 x 的深度尽可能大（一个节点也可以是它自己的祖先）。”</p><p>例如，给定如下二叉搜索树: root = [6,2,8,0,4,7,9,null,null,3,5]</p><p>示例 1:</p><ul><li>输入: root = [6,2,8,0,4,7,9,null,null,3,5], p = 2, q = 8</li><li>输出: 6</li><li>解释: 节点 2 和节点 8 的最近公共祖先是 6。</li></ul><p>示例 2:</p><ul><li>输入: root = [6,2,8,0,4,7,9,null,null,3,5], p = 2, q = 4</li><li>输出: 2</li><li>解释: 节点 2 和节点 4 的最近公共祖先是 2, 因为根据定义最近公共祖先节点可以为节点本身。</li></ul><p>说明:</p><ul><li>所有节点的值都是唯一的。</li><li>p、q 为不同节点且均存在于给定的二叉搜索树中。</li></ul><div class="language-js"><pre><code><span class="token comment">// 输出 树根节点</span>\n<span class="token comment">//       6</span>\n<span class="token comment">//      / \\</span>\n<span class="token comment">//     2   8</span>\n<span class="token comment">//    / \\ / \\</span>\n<span class="token comment">//   0  4 7 9</span>\n<span class="token comment">//     / \\</span>\n<span class="token comment">//    3  5</span>\n</code></pre></div><h3 id="解题思路"><a class="header-anchor" href="#解题思路" aria-hidden="true">#</a> 解题思路</h3><p>二叉搜索树</p><ul><li><p>p 和 q 值都小于当前节点值时，p 和 q 的最近公共祖先就在左子树</p></li><li><p>p 和 q 值都大于当前节点值时，p 和 q 的最近公共祖先就在右子树</p></li><li><p>否则，<strong>当前节点就是 p 和 q 的最近公共祖先</strong>（此时 p 和 q 分布在当前节点的两侧，或其中一个等于当前节点）</p><p>如上述二叉搜索树：如果 2 处于[p, q]之间时，此时 p 就在节点 2 的左子树，q 在节点 2 的右子树，那么 2 就一定是 p 和 q 的最近公共祖先。</p></li></ul><p>递归三部曲：</p><ol><li><p>明确递归函数的参数和返回值</p><ul><li>参数 1：当前节点</li><li>参数 2：p</li><li>参数 3:q</li><li>返回值：最近公共节点</li></ul></li><li><p>明确终止条件</p><ul><li>当节点为 null 返回 null</li></ul></li><li><p>确定单层递归逻辑</p><ul><li><p>p 和 q 值都大于 当前节点值时，继续遍历左子树</p></li><li><p>p 和 q 值都小于 当前节点值时，继续遍历右子树</p></li><li><p>否则，返回当前节点</p><div class="language-js"><pre><code><span class="token keyword">if</span> <span class="token punctuation">(</span>cur<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> cur<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span>cur<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> cur<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span>\n    <span class="token comment">// 遍历左子树</span>\n    <span class="token comment">// 遍历右子树</span>\n    <span class="token keyword">return</span> cur\n</code></pre></div></li></ul></li></ol><div class="language-js"><pre><code><span class="token keyword">function</span> <span class="token function">lowestCommonAncestor</span><span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">null</span>\n\n  <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token function">lowestCommonAncestor</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>left<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token function">lowestCommonAncestor</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>right<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> root\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre></div><div class="language-js"><pre><code><span class="token comment">// 迭代法</span>\n<span class="token keyword">var</span> <span class="token function-variable function">lowestCommonAncestor</span> <span class="token operator">=</span> <span class="token keyword">function</span> <span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">null</span>\n  <span class="token keyword">while</span> <span class="token punctuation">(</span>root<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      <span class="token keyword">return</span> <span class="token function">lowestCommonAncestor</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>right<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q<span class="token punctuation">)</span>\n    <span class="token punctuation">}</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> p<span class="token punctuation">.</span>val <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> q<span class="token punctuation">.</span>val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      <span class="token keyword">return</span> <span class="token function">lowestCommonAncestor</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>left<span class="token punctuation">,</span> p<span class="token punctuation">,</span> q<span class="token punctuation">)</span>\n    <span class="token punctuation">}</span>\n    <span class="token keyword">return</span> root\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_701-二叉搜索树中的插入操作-🌟🌟"><a class="header-anchor" href="#_701-二叉搜索树中的插入操作-🌟🌟" aria-hidden="true">#</a> 701.二叉搜索树中的插入操作 🌟🌟</h2><p><a href="https://leetcode.cn/problems/insert-into-a-binary-search-tree/" target="_blank" rel="noopener noreferrer">力扣链接</a> 🌟🌟</p><h3 id="题目描述-2"><a class="header-anchor" href="#题目描述-2" aria-hidden="true">#</a> 题目描述</h3><p>给定二叉搜索树（BST）的根节点和要插入树中的值，将值插入二叉搜索树。 返回插入后二叉搜索树的根节点。 输入数据保证，新值和原始二叉搜索树中的任意节点值都不同。</p><p>注意，可能存在多种有效的插入方式，只要树在插入后仍保持为二叉搜索树即可。 你可以返回任意有效的结果。</p><p>示例:</p><div class="language-js"><pre><code><span class="token comment">// 给定二叉搜索树：</span>\n<span class="token comment">//       4</span>\n<span class="token comment">//      / \\</span>\n<span class="token comment">//     2  7</span>\n<span class="token comment">//    / \\</span>\n<span class="token comment">//   1  3</span>\n<span class="token comment">// 和 插入的值：5</span>\n\n<span class="token comment">// 返回二叉树</span>\n<span class="token comment">//       4</span>\n<span class="token comment">//      / \\</span>\n<span class="token comment">//     2   7</span>\n<span class="token comment">//    /\\  /</span>\n<span class="token comment">//   1 3 5</span>\n<span class="token comment">// 或者这个树也是有效的</span>\n<span class="token comment">//       5</span>\n<span class="token comment">//      / \\</span>\n<span class="token comment">//     2   7</span>\n<span class="token comment">//    / \\</span>\n<span class="token comment">//   1  3</span>\n<span class="token comment">//      \\</span>\n<span class="token comment">//      4</span>\n</code></pre></div><p>提示：</p><ul><li>给定的树上的节点数介于 0 和 10^4 之间</li><li>每个节点都有一个唯一整数值，取值范围从 0 到 10^8</li><li>-10^8 &lt;= val &lt;= 10^8</li><li>新值和原始二叉搜索树中的任意节点值都不同</li></ul><h2 id=""><a class="header-anchor" href="#" aria-hidden="true">#</a> <a href="https://programmercarl.com/0701.%E4%BA%8C%E5%8F%89%E6%90%9C%E7%B4%A2%E6%A0%91%E4%B8%AD%E7%9A%84%E6%8F%92%E5%85%A5%E6%93%8D%E4%BD%9C.html#%E7%AE%97%E6%B3%95%E5%85%AC%E5%BC%80%E8%AF%BE" target="_blank" rel="noopener noreferrer">#</a></h2><h3 id="解题思路-2"><a class="header-anchor" href="#解题思路-2" aria-hidden="true">#</a> 解题思路</h3><h4 id="递归"><a class="header-anchor" href="#递归" aria-hidden="true">#</a> 递归</h4><p>递归三部曲：</p><ol><li><p>确定递归函数的参数和返回值</p><ul><li>参数 1：当前节点</li><li>参数 2：要插入的值</li><li>返回值：root</li></ul></li><li><p>确定终止条件</p><p>如果当前节点为 null，则根据值创建新节点</p><div class="language-js"><pre><code><span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root1<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">TreeNode</span><span class="token punctuation">(</span>val<span class="token punctuation">)</span>\n</code></pre></div></li><li><p>确定单层递归逻辑</p><ul><li>当前节点值大于 val，继续遍历左子树</li><li>当前节点值小于 val，继续遍历右子树</li><li>否则，返回返回当前节点</li></ul></li></ol><div class="language-js"><pre><code><span class="token keyword">function</span> <span class="token function">insertIntoBST</span><span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> val</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">const</span> <span class="token function-variable function">setInOrder</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> val</span><span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">TreeNode</span><span class="token punctuation">(</span>val<span class="token punctuation">)</span>\n\n    <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> val<span class="token punctuation">)</span> root<span class="token punctuation">.</span>left <span class="token operator">=</span> <span class="token function">setInOrder</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>left<span class="token punctuation">,</span> val<span class="token punctuation">)</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> val<span class="token punctuation">)</span> root<span class="token punctuation">.</span>right <span class="token operator">=</span> <span class="token function">setInOrder</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>right<span class="token punctuation">,</span> val<span class="token punctuation">)</span>\n\n    <span class="token keyword">return</span> root\n  <span class="token punctuation">}</span>\n\n  <span class="token keyword">return</span> <span class="token function">setInOrder</span><span class="token punctuation">(</span>root<span class="token punctuation">,</span> val<span class="token punctuation">)</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h4 id="迭代"><a class="header-anchor" href="#迭代" aria-hidden="true">#</a> 迭代</h4><p>步骤：</p><ol><li>记录当前节点 root 以及父节点 parent（初始化时定义）</li><li>循环遍历当前节点，比较当前节点值和插入值</li><li>如果当前节点不为空，更新当前节点为左或右子节点，同时更新父节点</li><li>如果当前节点为空，根据父节点的值和插入值的大小，决定插入到左还是右</li><li>返回 root</li></ol><div class="language-js"><pre><code><span class="token keyword">function</span> <span class="token function">insertIntoBST</span><span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> val</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">TreeNode</span><span class="token punctuation">(</span>val<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n    <span class="token keyword">let</span> parent <span class="token operator">=</span> <span class="token keyword">null</span>\n    <span class="token keyword">let</span> cur <span class="token operator">=</span> root\n    <span class="token keyword">while</span> <span class="token punctuation">(</span>cur<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      parent <span class="token operator">=</span> cur\n      <span class="token keyword">if</span> <span class="token punctuation">(</span>cur<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        cur <span class="token operator">=</span> cur<span class="token punctuation">.</span>left\n      <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n        cur <span class="token operator">=</span> cur<span class="token punctuation">.</span>right\n      <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n    <span class="token keyword">let</span> node <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">TreeNode</span><span class="token punctuation">(</span>val<span class="token punctuation">)</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span>parent<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> val<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n      parent<span class="token punctuation">.</span>left <span class="token operator">=</span> node\n    <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n      parent<span class="token punctuation">.</span>right <span class="token operator">=</span> node\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n  <span class="token keyword">return</span> root\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_450-删除二叉搜索树中的节点-🌟🌟"><a class="header-anchor" href="#_450-删除二叉搜索树中的节点-🌟🌟" aria-hidden="true">#</a> 450.删除二叉搜索树中的节点 🌟🌟</h2><p><a href="https://leetcode.cn/problems/delete-node-in-a-bst/description/" target="_blank" rel="noopener noreferrer">力扣链接</a> 🌟🌟</p><h3 id="题目描述-3"><a class="header-anchor" href="#题目描述-3" aria-hidden="true">#</a> 题目描述</h3><p>给定一个二叉搜索树的根节点 root 和一个值 key，删除二叉搜索树中的 key 对应的节点，并保证二叉搜索树的性质不变。返回二叉搜索树（有可能被更新）的根节点的引用。</p><p>一般来说，删除节点可分为两个步骤：</p><p>首先找到需要删除的节点； 如果找到了，删除它。 说明： 要求算法时间复杂度为 $O(h)$，h 为树的高度。</p><p>示例:</p><p><img src="/blog/_assets/binary-tree-node-delete.a2133b70.png" alt="binary-tree-node-delete"></p><h3 id="解题思路-3"><a class="header-anchor" href="#解题思路-3" aria-hidden="true">#</a> 解题思路</h3><p>删除节点情况：</p><ol><li>没找到删除节点，则返回 null</li><li>删除节点是叶子节点，直接删除，不影响其他节点</li><li>删除节点只有一个子节点，删除节点，并用子节点替换删除节点</li><li>删除节点有两个子节点，则将删除节点的左子树头结点（左孩子）放到删除节点的右子树的最左面节点的左孩子上（右子树中最小值），返回删除节点右孩子为新的根节点</li></ol><h4 id="递归-2"><a class="header-anchor" href="#递归-2" aria-hidden="true">#</a> 递归</h4><p>递归三部曲：</p><ol><li><p>确定递归函数的参数和返回值</p><ul><li>参数 1：根节点</li><li>参数 2：要删除的值</li><li>返回值：搜索的值所在的节点</li></ul></li><li><p>确定终止条件</p><p>如果 root 为 null 则说明没找到删除的节点，返回 root</p><div class="language-js"><pre><code><span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token keyword">return</span> root\n</code></pre></div></li><li><p>确定单层递归逻辑</p><ul><li>要删除的值大于 root.val，则继续递归右子树</li><li>要删除的值小于 root.val，则继续递归左子树</li><li>要删除的值就是当前节点时： <ul><li>节点是叶子结点</li><li>节点只有一个子节点，则返回</li><li>左右节点都存在，将将当前节点的左子树头节点指向右子树最左边节点，并将右子树指向删除节点的父节点</li></ul></li></ul></li></ol><div class="language-js"><pre><code><span class="token keyword">function</span> <span class="token function">deleteNode</span><span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> key</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">)</span> <span class="token keyword">return</span> root\n  <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&gt;</span> key<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    root<span class="token punctuation">.</span>left <span class="token operator">=</span> <span class="token function">deleteNode</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>left<span class="token punctuation">,</span> key<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token keyword">if</span> <span class="token punctuation">(</span>root<span class="token punctuation">.</span>val <span class="token operator">&lt;</span> key<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    root<span class="token punctuation">.</span>right <span class="token operator">=</span> <span class="token function">deleteNode</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>right<span class="token punctuation">,</span> key<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">.</span>left <span class="token operator">&amp;&amp;</span> <span class="token operator">!</span>root<span class="token punctuation">.</span>right<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">null</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">.</span>left <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>right<span class="token punctuation">)</span> <span class="token keyword">return</span> root<span class="token punctuation">.</span>right\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>root<span class="token punctuation">.</span>right <span class="token operator">&amp;&amp;</span> root<span class="token punctuation">.</span>left<span class="token punctuation">)</span> <span class="token keyword">return</span> root<span class="token punctuation">.</span>left\n\n    <span class="token keyword">const</span> rightNode <span class="token operator">=</span> root<span class="token punctuation">.</span>right\n    <span class="token keyword">const</span> minNode <span class="token operator">=</span> <span class="token function">getMinNode</span><span class="token punctuation">(</span>root<span class="token punctuation">.</span>right<span class="token punctuation">)</span>\n    root<span class="token punctuation">.</span>val <span class="token operator">=</span> minNode<span class="token punctuation">.</span>val\n    root<span class="token punctuation">.</span>right <span class="token operator">=</span> <span class="token function">deleteNode</span><span class="token punctuation">(</span>rightNode<span class="token punctuation">,</span> minNode<span class="token punctuation">.</span>val<span class="token punctuation">)</span>\n  <span class="token punctuation">}</span>\n  <span class="token keyword">return</span> root\n<span class="token punctuation">}</span>\n<span class="token keyword">function</span> <span class="token function">getMinNode</span><span class="token punctuation">(</span><span class="token parameter">node</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">while</span> <span class="token punctuation">(</span>node<span class="token punctuation">.</span>left<span class="token punctuation">)</span> node <span class="token operator">=</span> node<span class="token punctuation">.</span>left<span class="token punctuation">;</span>\n  <span class="token keyword">return</span> node<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h4 id="迭代-2"><a class="header-anchor" href="#迭代-2" aria-hidden="true">#</a> 迭代</h4><div class="language-js"><pre><code><span class="token keyword">function</span> <span class="token function">deleteNodeIterative</span><span class="token punctuation">(</span><span class="token parameter">root<span class="token punctuation">,</span> key</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">let</span> parent <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>\n  <span class="token keyword">let</span> current <span class="token operator">=</span> root<span class="token punctuation">;</span>\n  \n  <span class="token comment">// 查找目标节点</span>\n  <span class="token keyword">while</span> <span class="token punctuation">(</span>current <span class="token operator">&amp;&amp;</span> current<span class="token punctuation">.</span>val <span class="token operator">!==</span> key<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    parent <span class="token operator">=</span> current<span class="token punctuation">;</span>\n    current <span class="token operator">=</span> key <span class="token operator">&lt;</span> current<span class="token punctuation">.</span>val <span class="token operator">?</span> current<span class="token punctuation">.</span>left <span class="token operator">:</span> current<span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  \n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>current<span class="token punctuation">)</span> <span class="token keyword">return</span> root<span class="token punctuation">;</span> <span class="token comment">// 未找到</span>\n  \n  <span class="token comment">// Case 1: 无子节点</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>current<span class="token punctuation">.</span>left <span class="token operator">&amp;&amp;</span> <span class="token operator">!</span>current<span class="token punctuation">.</span>right<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>parent<span class="token punctuation">)</span> <span class="token keyword">return</span> <span class="token keyword">null</span><span class="token punctuation">;</span> <span class="token comment">// 删除根节点</span>\n    parent<span class="token punctuation">[</span>current <span class="token operator">===</span> parent<span class="token punctuation">.</span>left <span class="token operator">?</span> <span class="token string">&#39;left&#39;</span> <span class="token operator">:</span> <span class="token string">&#39;right&#39;</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>\n    <span class="token keyword">return</span> root<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  \n  <span class="token comment">// Case 2: 单个子节点</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>current<span class="token punctuation">.</span>left <span class="token operator">||</span> <span class="token operator">!</span>current<span class="token punctuation">.</span>right<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">const</span> child <span class="token operator">=</span> current<span class="token punctuation">.</span>left <span class="token operator">||</span> current<span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>parent<span class="token punctuation">)</span> <span class="token keyword">return</span> child<span class="token punctuation">;</span> <span class="token comment">// 删除根节点</span>\n    parent<span class="token punctuation">[</span>current <span class="token operator">===</span> parent<span class="token punctuation">.</span>left <span class="token operator">?</span> <span class="token string">&#39;left&#39;</span> <span class="token operator">:</span> <span class="token string">&#39;right&#39;</span><span class="token punctuation">]</span> <span class="token operator">=</span> child<span class="token punctuation">;</span>\n    <span class="token keyword">return</span> root<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  \n  <span class="token comment">// Case 3: 两个子节点</span>\n  <span class="token keyword">const</span> successorParent <span class="token operator">=</span> current<span class="token punctuation">;</span>\n  <span class="token keyword">let</span> successor <span class="token operator">=</span> current<span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n  <span class="token keyword">while</span> <span class="token punctuation">(</span>successor<span class="token punctuation">.</span>left<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    successorParent <span class="token operator">=</span> successor<span class="token punctuation">;</span>\n    successor <span class="token operator">=</span> successor<span class="token punctuation">.</span>left<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  \n  current<span class="token punctuation">.</span>val <span class="token operator">=</span> successor<span class="token punctuation">.</span>val<span class="token punctuation">;</span>\n  <span class="token keyword">if</span> <span class="token punctuation">(</span>successorParent <span class="token operator">===</span> current<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    successorParent<span class="token punctuation">.</span>right <span class="token operator">=</span> successor<span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>\n    successorParent<span class="token punctuation">.</span>left <span class="token operator">=</span> successor<span class="token punctuation">.</span>right<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  \n  <span class="token keyword">return</span> root<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',56)];t.render=function(a,p,t,e,c,l){return n(),s("div",null,o)};export{p as __pageData,t as default};
